import Get from "./components/GetAxios";
import GetMath from "./components/RandomMath";
import PostCard from "./components/PostCard";
import { Routes, Route } from "react-router-dom";
import React from "react";

function App() {
  return (
    <React.Fragment>
      <div className="rounded" style={{ marginTop: "20px" }}>
        <h1 className="">Vannara Thong Portfolio</h1>
      </div>

      <div className="container">
        <hr />
        {false && <Get />} {false && <GetMath />}
        <PostCard />
        {/* Route Components Below 


        */}
        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/create" element={<Create />} />
            <Route path="/blogs/:id" element={<BlogDetails />} />
            <Route path="*" element={<NotFound />} />
          </Routes>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
